/**--列车运输人数---*/
IF EXISTS (SELECT * FROM sysobjects WHERE type = 'U' AND name = 'newtrainserverpeople')
	BEGIN
		DROP  Table newtrainserverpeople
	END
GO

CREATE TABLE newtrainserverpeople
(
   
  num       integer not null primary key,
  byear     integer not null,
  bmonth    integer not null,
  trainname varchar(50) not null,
  astation  varchar(50) not null,
  bstation  varchar(50) not null,
  pc1       integer,								--本企业旅客人数
  pc2       integer,								--外企业(国铁)旅客人数
  pc3       integer,								--外企业(非国铁)旅客人数
  price     numeric(18,2),							--旅客服务费单价
  fee1      numeric(18,2),							--本企业旅客服务费
  fee2      numeric(18,2),							--外企业(国铁)旅客服务费
  fee3      numeric(18,2)							--外企业(非国铁)旅客服务费

)
GO

